import React from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
} from '@material-ui/core';

const AppHeader = () => (
  <AppBar position="static">
    <Toolbar>
      <Typography variant="h6" color="inherit">
        Flight LH99 - Munich to San Francisco
      </Typography>
    </Toolbar>
  </AppBar>
);

export default AppHeader;
